import './App.css';
import Header from './components/Header';
import About from './components/About';
import Home from './components/Home';
import Project from './components/Projects';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (
        <>
        <Router>
          <Switch>
            <Route path="/about">
              <About />
            </Route>
            <Route path="/users">
              <Users />
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </Router>
        </>
  );
}

export default App;
